INSERT INTO `table_artikel` (`id`, `str_title`, `dte_publish`, `str_penulis`, `str_keyword`, `str_abstrak`, `str_abstract`, `id_ktgr`, `thn_terbit`, `file`, `count`) VALUES
(1, 'RANCANG BANGUN APLIKASI UNTUK MENGENALKAN ANEKA HEWAN KEPADA ANAK-ANAK DENGAN AUGMENTED REALITY (BERBASIS ANDROID)', '2017-07-01', 'Sunandar', 'Aplikasi perangkat mobile, jenis hewan Augmented Reality, asset store, Unity 3D, Vuforia.', 'Augmented Reality pengenalan aneka jenis hewan berbasis mobile merupakan cara baru dalam mengenalkan aneka hewan kepada anak-anak. Aplikasi ini juga diharapkan mampu membantu orang tua dalam mengenalkan aneka jenis hewan kepada anak-anak diusia dini. Dalam pembuatan aplikasi Augmented Reality pengenalan jenis hewan berbasis mobile ini, menggunakan media berupa aplikasi Unity 3D, Vuforia serta asset store sebagai media untuk mengimport objek 3D. Unity 3D berisi editor untuk merancang komponen pada aplikasi, Vuforia sebagai library pembuatan marker. Tahap akhir dari penelitian ini adalah berupa aplikasi yang dapat berjalan di perangkat mobile dengan sistem operasi android .Marker disini berfungsi sebagai pengenal ketika aplikasi ini dijalankan diperangkat mobile android. Sehingga perangkat mobile android tersebut dapat menampilkan jenis hewan dalam bentuk 3dimensi beserta animasinya dan suara dari nama jenis hewan yang ditampilkan di perangkat mobile android. Aplikasi ini dapat dijadikan referensi pembelajaran serta untuk memperkenalkan aneka jenis hewan kepada anak-anak dengan lebih praktis, inovatif dan interaktif. ', '', 49, 2016, '', 2),
(2, 'RANCANG BANGUN SISTEM AKSES KELUAR MASUK RUMAH MENGGUNAKAN SOLENOID DOORLOCK DAN SENSOR FINGERPRINT BERBASIS MIKROKONTROLER ATMEGA 328', '2017-07-20', 'Slamet Riyanto, Kristian Ismail dan Muhammad Sabar', 'Sistem, Mikrokontroler Atmega 328, Fingerprint, Solenoid Doorlock, LCD, Arduino IDE 1.0.4, Fingerprint SFG', 'Rancang bangun  sistem akses  keluar masuk rumah menggunakan solenoid doorlock dan sensor fingerprint berbasis Atmega 328 adalah sebagai piranti yang digunakan untuk mengamankan pintu rumah dari pencurian, atau tindakan – tindakan yang dapat merugikan pemilik rumah. Metode yang digunakan dalam membangun sistem kontrol masuk rumah menggunakan solenoid doorlock dan sensor fingerprint berbasis Atmega 328 ini adalah metode yang digunakan adalah :(1)Metode Pengumpulan Data, (2) Metode perancangan Alat, (3) Metode Pengujian Alat, (4) Metode Prototipe. Sistem pada alat terdiri dari unit mikrokontroler  Atmega 328 sebagai kontrol utama dalam sistem yang ada, mikrokontroler jenis ini tertanam dalam papan pcb kloningann dari arduino uno. Dalam perancangan alat terdiri dari perangkat keras  dan perangkat lunak. Perangkat keras  Catu Daya, Modul Fingerprint ZFM-20, LCD(Liquid Crystal Display), Solenoid Doorlock, USB Serial FTDI, Buzzer, Driver Relay 12 V, Resistor, Kapasitor, Dioda. Sedangkan perangkat lunak yang digunakan aplikasi pemrograman bahasa C adalah  Arduino IDE 1.0.4 untuk menuliskan listing programnya dan program fingerprint SFG digunakan  untuk proses memasukan data sidik jari ke dalam mikrokontroler. ', '', 49, 2016, '', 0),
(3, 'PERANCANGAN APLIKASI INFORMASI DOSEN \r\nPADA SEKOLAH TINGGI TEKNOLOGI BANDUNG BERBASIS MOBILE', '2017-07-21', 'Robby Al Jufri', 'Sistem Informasi Dosen (SID), dosen, mobile apps, Android.', 'Tujuan pembuatan aplikasi informasi dosen berbasis mobile ini adalah untuk memberikan kemudahan bagi dosen dalam memperoleh informasi akademik dimanapun dan kapanpun. Selain itu juga aplikasi ini diharapkan dapat membantu dosen dalam kegiatan akademik seperti memperoleh informasi catatan perkuliahan, melihat daftar mahasiswa, memberi nilai akhir, memperoleh informasi akademik, memperoleh informasi catatan perkuliahan dan pengabdian, dan untuk memberikan keluhan dan saran menjadi lebih efektif dari segi waktu dan menghemat penggunaan kertas. Aplikasi ini telah didemokan pada 21 dosen di Sekolah Tinggi Teknologi Bandung. Aplikasi ini menggunakan fungsi push notification agar setiap pengguna dapat mengetahui info terbaru mengenai informasi akademik. Aplikasi ini dibangun dengan menggunakan ndroid Studio versi 2.1 dengan Bahasa pemrograman Java dan XML. Hasil akhir dari penelitian ini berupa aplikasi berbasis mobile yang diberinama Sistem Informasi Dosen (SID) dengan sistem operasi Android yang dapat digunakan pada minimal sistem operasi Android versi 4.0 IceCream Sandwich.', '', 49, 2016, '', 0),
(4, 'SISTEM KENDALI DAN KEAMANAN MOTOR\r\nMENGGUNAKAN ARDUINO UNO BERBASIS ANDROID', '2017-07-25', 'Riri Suryadi', 'android, Bluetooth HC-05, sepeda motor, arduino', 'alam sistem keamanan pada kendaraan bermotor pada masa kini, keamanannya kurang terjamin, itu bisa dibuktikan dengan adanya laporan kasus pencurian sepeda motor yang setiap tahunnya semakin meningkat. Maka dari itu penulis ingin menciptakan tambahan sistem keamanan pada kendaraan bermotor yang menggunakan android, yang berguna untuk mengurangi terjadinya pencurian sepeda motor, dengan alat sistem keamanan ini akan di letakan di bagian kendaraan bermotor yang akan ditambahkan alat, dengan cara menggunakan bluetooth HC-05, yang menggunakan perangkat arduino. Dengan sistem ini diharapkan bisa mengurangi terjadinya pencurian sepeda motor yang marak terjadi di masa kini, Dengan perancangan sistem pada alat tersebut akan tercipta sebuah alat yang dapat mengurangi terjadinya pencurian sepeda motor dan mengurangi kerugian materi pada pengguna kendaraan bermotor, dan keamanan lebih terjamin.', '', 49, 2016, '', 0),
(5, 'PENERAPAN METODE BUBBLE SORT\r\nPADA HASIL PENGUKURAN VO2MAX\r\nBERBASIS MOBILE', '2017-07-27', 'Nurbaeti Komalasari', 'mobile application, VO2Max, test, bubble sort, PDF.', 'Olahraga adalah suatu kegiatan yang dilakukan oleh masyarakat untuk menjaga dan meningkatkan kesehatan. Dengan olahraga juga dapat meningkatkan kebugaran fisik dan menurunkan resiko penyakit. Olahraga harus dilakukan dengan baik, benar, terukur dan mengikuti aturan atau arahan dari seorang instruktur atau pelatih olahraga, sehingga dapat memperbaiki sistem dan fungsi dari organ tubuh. Dalam bidang olahraga untuk menentukan tingkat kebugaran untuk seorang atlet salah satunya adalah dengan melihat kemampuan organ paru-paru dalam menyerap oksigen atau sering disebut VO2Max (Volume Oksigen Maximum). Semakin tinggi kemampuan seseorang dalam menyerap oksigen maka semakin tinggi tingkat kebugarannya. Pengukuran VO2Max yang masih dilakukan secara manual dirasa kurang efektif dalam mendapatkan hasil pengukurannya, karena itu penulis mencoba mengembangkan mobile application yang bisa melakukan proses pengukuran VO2Max. Data diukur melalui serangkaian test, antara lain: balke test, cooper test, lion test dan multistage fitness test. Dimana hasil setiap test akan diurutkan dengan metode bubble sort. Dari beberapa hasil pengujian didapatkan berupa hasil test yang terurut untuk melihat urutan yang paling baik dan hasil test tersebut dapat disimpan ke dalam bentuk PDF.', '', 49, 2016, '', 0),
(6, 'USULAN PENERAPAN METODE SIX SIGMA PADA PROSES OVERHAUL UNTUK  MENGURANGI  RETURN TO SHOP (RTS) ENGINE SOLAR (STUDI KASUS DI PT. XYZ BANDUNG)', '2017-08-01', 'Nanang Sarwoto,', 'RTS, DMAIC, DPMO, SIX SIGMA', 'PT. XYZ adalah perusahaan yang bergerak di bidang jasa perbaikan mesin turbin, misalnya solar engine. TAT (Turn Around Time), ketersediaan suku cadang dan kualitas pekerjaan adalah menjadi hal yang sangat penting. Untuk mengetahui, menganalisa dan mengatasi variasi produk yang terjadi, dapat digunakan suatu metode pengendalian kualitas yaitu Six Sigma melalui tahapan DMAIC (Define, Measure, Analyze, Improve dan Control). \r\nDari hasil analisis diperoleh bahwa nilai Sigma PT. XYZ adalah 3,27 dengan DPMO 42.168,67. Potensial kegagalan pada defect high vibration adalah proses balancing tidak akurat dengan RPN sebesar 378 dengan usulan perbaikannya adalah upgrading mesin balancing. Potensial defect yang menyebabkan low power adalah kesalahan pengukuran dengan RPN 280 dan usul perbaikannya adalah memberikan pelatihan dan pengecekan ulang pada saat proses assembly.', '', 48, 2016, '', 0),
(7, 'PEMBUATAN TROLI OTOMATIS \r\nDI PT. BINA CITRA KHARISMA LESTARI \r\nBERBASIS MIKROKONTROLER', '2017-08-01', 'Indra R Antoni F S,Kristian Ismail, Nila R.', 'Perancangan, Mikrokontroler Atmega8, Troli, Troli Otomatis, Octopus, Pt. Bina Citra Kharisma Lestari, smart bot car.', 'Pembuatan sistem troli otomatis pada Pt. Bina Citra Kharisma Lestari berbasis mikrokontroler adalah sebagai piranti yang digunakan untuk membantu mempermudah kinerja karyawan gudang dalam melakukan kegiatan pengiriman barang dalam jumlah banyak dan beban yang cukup berat. Metode yang digunakan dalam membangun sistem troli otomatis pada Pt. Bina Citra Kharisma Lestari berbasis mikrokontroler ini adalah : (1) Metode Pengumpulan Data, (2) Metode perancangan Alat, (3) Metode Pengujian Alat, (4) Metode Prototipe. Sistem pada alat terdiri dari unit mikrokontroler  ATmega 8 sebagai kontrol utama dalam sistem yang ada, mikrokontroler jenis ini tertanam dalam papan pcb Octopus. Dalam perancangan alat terdiri dari perangkat keras  dan perangkat lunak. Perangkat keras  Catu Daya, Sensor garis, Sensor Ultrasonik HC-SR04, casis smart bot car, Motor DC, Driver motor DC L293D, Resistor, Kapasitor. Sedangkan perangkat lunak yang digunakan aplikasi pemrograman bahasa C adalah Octopus untuk menuliskan listing programnya.', '', 49, 2016, '', 0),
(8, 'Aplikasi Sistem Pakar\r\nDiagnosis Gangguan Kesehatan Pada Balita\r\nMenggunakan Metode Forward Chaining Berbasis Web', '2017-08-02', 'Asep Purnama', 'Diagnosis, Konsultasi, Forward chaining, web, Sistem pakar', 'Kasus gangguan kesehatan pada balita sering terjadi selain karena faktor usia balita yang masih rentan terhadap penyakit, keterlambatan orangtua dalam mengetahui kesehatan balita menjadi pengaruh serta sistem yang berjalan dalam berkonsultasi saat ini masih kurang maksimal dengan cara manual. Dengan demikian aplikasi diagnosis gangguan kesehatan pada balita berbasis web ini diharapkan mampu mengatasi persoalan orangtua untuk berkonsultasi kesehatan balitanya, aplikasi ini dapat menentukan lima penyakit pada balita, yaitu diare, infeksi saluran pernafasan akut(ISPA), penyakit kulit, tuberkulosis(TBC) dan meningitis menggunakan keputusan dari algoritma metode Forward Chaining. Aplikasi ini berbasis Sistem Pakar dibangun menggunakan bahasa pemrograman PHP, antarmuka dibangun menggunakan HTML dan basis data menggunakan MySql sebagai media penyimpanan data. Dengan menggunakan metode Forward Chaining pengguna aplikasi lebih mudah berinteraksi dengan sistem, pengguna aplikasi hanya menjawab pertanyaan-pertanyaan dari aplikasi seputar gejala yang dialami pada balita dengan memilih jawaban Ya atau Tidak. Selain menentukan jenis penyakit dalam aplikasi juga terdapat solusi dan informasi jenis penyakit untuk membantu pengguna dalam pembelajaran kesehatan pada balita. ', '', 49, 2016, '', 0),
(9, 'RANCANG BANGUN SISTEM KUNCI ELEKTRONIK TAMBAHAN SEPEDA MOTOR BERBASIS MIKROKONTROLER ATMEGA328', '2017-08-02', 'Fikri Akbarul Haq, Kristian Ismail,Ari Hadhiwibowo', 'kunci elektronik tambahan, sepeda motor, password, modul Arduino Uno', 'Tingkat kriminalitas terhadap kendaraan bermotor semakin meningkat khususnya sepeda motor, hal ini tentunya membuat faktor keamanan dan kenyamanan pemilik sepeda motor belum tercapai. Sistem kunci elektronik tambahan sepeda motor ini menggunakan Keypad sebagai alat input password, Modul Arduino Uno sebagai pengendali utama, LCD sebagai display, LED sebagai lampu indikator dan Modul Aktuator untuk menghubungkan dan memutuskan sistem kelistrikan sepeda motor. Prinsip kerja alat ini yaitu ketika ada masukan berupa password melalui Keypad kemudian jika password yang dimasukan benar, maka Modul Arduino Uno akan memberikan input HIGH kepada Modul Aktuator sehingga Relay yang berada pada Modul Aktuator akan berpindah kontak menjadi NC dan LCD akan menampilkan tulisan “Password Benar”. Pada sistem keamanan sepeda motor ini terdapat fitur mengubah password. Dari hasil pengujian yang telah dilakukan, menunjukan bahwa sistem keamanan sepeda motor ini bekerja dengan baik tetapi alat ini masih memiliki kelemahan yakni alat ini tidak memiliki algoritma proteksi keamanan dan ukuran box yang masih cukup besar. ', '', 49, 2016, '', 0),
(10, 'DECISION SUPPORT SYSTEM UNTUK KLASIFIKASI PENYANDANG DISABILITAS DENGAN METODE FORWARD CHAINING BERBASIS MOBILE', '2017-08-04', 'Niken Riyanti', 'lassification support system, disabilitas, decision support system, minimum disability criteria, classification.', '\r\nTujuan pengembangan aplikasi Classification Support System (CSS) ini adalah untuk membantu penyandang disabilitas yang berminat dibidang olahraga untuk mengetahui kelas dan cabang olahraga yang mungkin bisa diikutinya.  Aplikasi CSS ini merupakan Decision Support System dengan metode Forward Chaining dalam prosesnya. Aplikasi ini diuji coba pada atlet tuna daksa cabang atletik Jawa Barat yang akan mengikuti PEPARNAS Jawa Barat 2016. Aturan yang diterapkan dalam CSS ini adalah Minimum Disability Criteria (MDC) yang dikeluarkan oleh International Paralympic Committee (IPC). Dalam pembuatan aplikasi ini, menggunakan Android Studio versi 1.5 dengan Bahasa pemrograman Java dan XML. Hasil akhir dari penelitian ini berupa aplikasi berbasis mobile dengan sistem operasi Android yang dapat digunakan pada minimal sistem operasi Android versi 4.0 IceCream Sandwich. Aplikasi ini dapat dijadikan sumber informasi bagi penyandang disabilitas yang ingin mengetahui klasifikasinya dan saran cabang olahraga yang cocok berdasarkan klasifikasi yang dihasilkan.\r\n', '', 49, 2016, '', 0);
